$(document).ready(()=>{"use strict";const selectAnnouncementTarget=$("select#id_announcement_target");const selectAnnouncementChannel=$("select#id_announcement_channel");const inputCsrfMiddlewareToken=$('input[name="csrfmiddlewaretoken"]');const getPingTargetsForCurrentUser=()=>{$.ajax({url:discordAnnouncementsSettings.url.getAnnouncementTargets,success:data=>{$(selectAnnouncementTarget).html(data)}})};const getWebhooksForCurrentUser=()=>{$.ajax({url:discordAnnouncementsSettings.url.getAnnouncementWebhooks,success:data=>{$(selectAnnouncementChannel).html(data)}})};(()=>{getPingTargetsForCurrentUser();getWebhooksForCurrentUser()})()});